import { Injectable } from '@angular/core';
import { Product } from 'src/app/ProductsModule/Core/Domain/Entities/Product';
import { IProductsRepository } from 'src/app/ProductsModule/Core/Domain/Repositories/IProductsRepository';
import { products } from 'src/app/products';

@Injectable()
export class ProductsRepositoryService implements IProductsRepository {

  public getProducts(): Product[] {
    return [
      {
        id: 1,
        name: 'Phone XL',
        price: 799,
        description: 'A large phone with one of the best screens'
      },
      {
        id: 2,
        name: 'Phone Mini',
        price: 699,
        description: 'A great phone with one of the best cameras'
      },
      {
        id: 3,
        name: 'Phone Standard',
        price: 299,
        description: ''
      }
    ];
  }
}
